import React from "react";
import { Text, View } from 'react-native';

function PastJobs() {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Completed jobs from the past</Text>
      </View>
  );
}
export default PastJobs;
